    "jnotes": "<p>Jim here, sitting in for Jeff Chen, who is counting the number of puppeteers needed to manipulate Topo Gigio, in Italian!</p>\r\n\r\n<p>I think I understand this one. Some answers peek out the top. You have to raise oBJECTIONS, raise a sTINK, raise the mINIMUM WAGE, and raise a fAMILY to make the clues make sense.</p>\r\n\r\n<p>Down below, you have to lower the VOLUMe, lower the TEMPERATURe, and lower the PRICe to fit the clues. And finally, in a bit of classic crossword humor, you have to please, for God&#39;s sake, for once in your life, lower the damn TOILET SEAt. (On the other hand, it bugs the heck out of me that some thoughtless people leave the seat down, which is just so very inconvenient! We aim for equally balanced offense here.)</p>\r\n\r\n<div><a href=\"https://www.imdb.com/title/tt3526078/\"><img alt=\"\" class=\"center\" src=\"https://static01.nyt.com/images/2020/09/20/business/20emmys-ohara/20emmys-ohara-jumbo.jpg?quality=75&amp;auto=webp\" style=\"width:525px\" title=\"Moira Schitt\" /></a></div>\r\n\r\n<p>Will Shortz insists that Thursday is simply &quot;one harder than Wednesday,&quot; but we&#39;ve come to expect Thursday to be gimmick day. <a href=\"https://www.nytimes.com/crosswords/submissions\">NYT submission guidelines</a> say they already have plenty of rebus puzzles, so what&#39;s a gimmickologist to do? One option is to color outside the lines. Today&#39;s example was brave because there&#39;s no explicit revealer, like <a href=\"https://www.xwordinfo.com/Crossword?date=2/7/2019&amp;g=58&amp;d=A\">GO OVER THE EDGE</a> or <a href=\"https://www.xwordinfo.com/Crossword?date=1/7/2016&amp;g=34&amp;d=A\">DOCTORS WITHOUT BORDERS</a> or <a href=\"https://www.xwordinfo.com/Crossword?date=4/1/2006&amp;g=39&amp;d=A\">THINK OUTSIDE THE BOX</a> or <a href=\"https://www.xwordinfo.com/Crossword?date=5/16/2013&amp;g=51&amp;d=A\">MAN OVERBOARD</a>. Hopefully, you had a nice Aha Moment.</p>\r\n\r\n<p>If you&#39;re curious about how other constructors have broken through the outer wall, <a href=\"https://www.xwordinfo.com/Floats\">the complete list is here</a>.</p>\r\n\r\n<p>Our OneLook finder can help find phrases that start with <a href=\"https://www.xwordinfo.com/Finder?dm=E4QwlgzgpgBAVEA\">RAISE</a> or <a href=\"https://www.xwordinfo.com/Finder?dm=DYew7gpgTgBAVEA\">LOWER</a>.</p>",
